import React from 'react'
import { ChakraProvider, Box, Stack} from '@chakra-ui/react'

const Tweet = () => {
    const tweet_border = {
        borderTop: "10px solid #38444D",
        borderBottom: "1px solid #38444D",
      };
    return (
        <ChakraProvider>
            <Box w="600px" h="110px" style={tweet_border} ml="-17px" bg="tomato">

            </Box>
        </ChakraProvider>
    )
}

export default Tweet
